import React from 'react';
import Home from './Pages/Home';
import ReactDOM from 'react-dom';
import Footer from './Components/Footer';

class Index {
    render() {
        return(
			<div>
            <Header/>
            <Home/>
            <Footer/>
			</div>
        );
    }
}


if (document.getElementById('root')) {
    ReactDOM.render(<Index />, document.getElementById('root'));
}

